import React, {Component} from 'react';
import {BrowserRouter as Router, Route, Link} from 'react-router-dom';
import Layout from './Constants/Layout.js';
import AccountTab from './Account/AccountTab.js';
import PatientCollection from './Patient/PatientCollection.js';

const Index = () => <h2>Home</h2>;


class SamplePage extends Component{
    render(){
        return(
            <Router>
                <div>



                <Route path="/" exact component={Layout}></Route>
                <Route path="/accountTab/" component={AccountTab}></Route>
                <Route path="/patientCollection/" component={PatientCollection}></Route>
                </div>
            </Router>
        );
    }
}

export default SamplePage;
